skills:
Дополнительно к указанному опыту:
- почти год опыта разработки веб-проектов на Django и aiohttp (на фрилансе в составе небольшой команды) параллельно основной работе (HTML, Bootstrap, JS, PostgreSQL);
- участие в хакатонах (в последний раз участвовал в Архипелаге в составе команды, которая разрабатывала систему прогнозирования нефтяных котировок в зависимости от новостного фона).

Общие компетенции:
- участие в полном цикле разработки - программирование, тестирование (unittest, pytest), написание технической документации (swagger), развертывание, поддержка;
- опыт написания многопоточного и асинхронного кода;
- опыт написания и использования REST API (aiohttp, Flask);
- опыт разработки веб-приложений (Django, aiohttp, Flask) с относительно простым фронтом (Bootstrap, JS);
- опыт работы с очередями (RabbitMQ);
- опыт работы с кешами (Redis);
- опыт работы с реляционными СУБД (PostgreSQL) и навыки написания запросов средней сложности;
- опыт разработки и развертывания в unix-окружении (являюсь пользователем ОС Ubuntu);
- опыт работы с Docker;
- опыт работы с git;
- опыт работы с ElasticSearch;
- есть интерес к сфере машинного обучения и анализа данных (в настоящий момент занимаюсь соответствующей математический базой);
- есть небольшой опыт менторства;

GitHub: https://github.com/tardonyx
(в данный момент репозиторий пополняется)

